import React, { useState } from "react";
import "./add-crops.css";
import { useParams } from "react-router-dom";

export default function AddCrop() {
  const { userId } = useParams();
  const [name, setName] = useState("");
  const [variety, setVariety] = useState("regular");
  const [category, setCategory] = useState("vegetable");
  const [label, setLabel] = useState("local");
  const [harvestDate, setHarvestDate] = useState("");
  const [quantity, setQuantity] = useState("");
  const [unit, setUnit] = useState("kg");
  const [pricePerUnit, setPricePerUnit] = useState("");
  const [location, setLocation] = useState({ coordinates: [] });

  const handleSubmit = async (event) => {
    event.preventDefault();

    try {
      const response = await fetch(`http://localhost:5001/api/commerce/add/${userId}`, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          name,
          variety,
          category,
          label,
          harvestDate,
          quantity,
          unit,
          pricePerUnit,
          location,
          sellerId: userId,
        }),
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      console.log(data.message);
    } catch (error) {
      console.error("There was a problem with the fetch operation:", error);
    }
  };

  const getCurrentLocation = () => {
    if (!navigator.geolocation) {
      console.log("Geolocation is not supported by this browser.");
      alert('Error setting location allow acess');
      return;
    }

    navigator.geolocation.getCurrentPosition((position) => {
      setLocation({
        coordinates: [position.coords.longitude, position.coords.latitude],
      });
    });
    alert('Location is set');
  };

  return (
    <form onSubmit={handleSubmit} className="add-crop-form">
      <input
        type="text"
        placeholder="Name"
        value={name}
        onChange={(event) => setName(event.target.value)}
        className="form-input"
        required
      />
      <select
        value={variety}
        onChange={(event) => setVariety(event.target.value)}
        className="form-input"
      >
        <option value="regular">Regular</option>
        <option value="dwarf">Dwarf</option>
        <option value="special">Special</option>
      </select>
      <select
        value={category}
        onChange={(event) => setCategory(event.target.value)}
        className="form-input"
      >
        <option value="vegetable">Vegetable</option>
        <option value="fruit">Fruit</option>
      </select>
      <select
        value={label}
        onChange={(event) => setLabel(event.target.value)}
        className="form-input"
      >
        <option value="local">Local</option>
        <option value="non-local">Non-local</option>
      </select>
      <input
        type="date"
        placeholder="Harvest Date"
        value={harvestDate}
        onChange={(event) => setHarvestDate(event.target.value)}
        className="form-input"
      />
      <input
        type="number"
        placeholder="Quantity"
        value={quantity}
        onChange={(event) => setQuantity(event.target.value)}
        className="form-input"
      />
      <select
        value={unit}
        onChange={(event) => setUnit(event.target.value)}
        className="form-input"
      >
        <option value="kg">kg</option>
        <option value="ton">ton</option>
      </select>
      <input
        type="number"
        placeholder="Price Per Unit"
        value={pricePerUnit}
        onChange={(event) => setPricePerUnit(event.target.value)}
        className="form-input"
      />
      <button
        type="button"
        onClick={getCurrentLocation}
        className="form-button"
      >
        Set Current Location
      </button>
      <button type="submit" className="form-button">
        Add Crop
      </button>
    </form>
  );
}
